DROP TABLE IF EXISTS marketing.ca;
CREATE TABLE marketing.ca(
   user_id             VARCHAR(10) NOT NULL
  ,date_served         DATE 
  ,marketing_channel   VARCHAR(9)
  ,variant             VARCHAR(15) NOT NULL
  ,converted           VARCHAR(5)
  ,language_displayed  VARCHAR(7) NOT NULL
  ,language_preferred  VARCHAR(7) NOT NULL
  ,age_group           VARCHAR(11) NOT NULL
  ,date_subscribed     DATE 
  ,date_canceled       DATE 
  ,subscribing_channel VARCHAR(9)
  ,is_retained         VARCHAR(5)
);
